VALUES ('8710398511140', 'Barres de flocons d\'avoine', 'QUAKER Volkoren haver Zonder kunstmatig geur- en Amaaks -&gt;&gt;&gt; 1877 HAVERMOUT FLOCONS D\'AVOINE REPEN BARRE S HAVERMOUTREEP MET STUKJES CHOCOLADE. INGREDIENTEN: Volkoren havermout (47%), glucosesiroop, krokante granenvlokken (tarwemeel, rijstmeel, tarwemout), oligofructose, chocolade stukjes (4,8%) [cacaomassa, suiker, cacaoboter, emulgator (soja-lecithine)l, zonnebloemolie, suiker, bevochtigings middel (glycerol), honing, magere melkpoeder, stabilisator (isomalt), zout, kleurstof (karamel), melasse, antioxidant (natuurlijk tocopherol) Chocolade bevat ten minste 49% cacaobestanddelen. Dit product kan sporen van pinda\'s, noten en sesam bevatten. BARRES AUX FLOCONS D\'AVOINE ET MORCEAUX DE CHOCOLAT. INGRÉDIENTS: flocons d\'avoine complets (47%), sirop de glucose, pétales de céréales croquants (farine de blé, farine de riz, malt de blé), oligofructose, morceaux de chocolat noir (4,8%) [masse de cacao, sucre, beurre de cacao, émulsifiant (lécithine de soja)l, huile de tournesol, sucre, humectant (glycerol), miel, poudre de lait écrémé, stabilisant (isomalt), sel, colorant (caramel), mélasse, antioxydant (tocophérol). Le chocolat contient au minimum 49% de cacao. Ce produit peut contenir des traces de cacahuètes, de fruits à coques et de sésame.', 'https://static.openfoodfacts.org/images/products/871/039/851/1140/front_fr.4.400.jpg', '11', '3.5', '66', '16', '', '7.8', '0.4', '0.15748031496063', '', '1');

